// ==UserScript==
// @name        TomatoAlarm
// @description In the manner of the Pomodoro Technique, an alarm (the sound of a wind chime) is sounded once every 10 minutes after the start button is pressed.
// @match       https://calendar.google.com/calendar/*
// @author      hidao80
// @version     1.1
// @namespace   https://github.com/hidao80/UserScript
// @licence     MIT
// @icon        data:image/svg+xml;base64,
// @run-at      document-end
// @grant       none
// @updateURL   https://github.com/hidao80/UserScript/raw/main/TomatoAlarm/TomatoAlarm.user.js
// @downloadURL https://github.com/hidao80/UserScript/raw/main/TomatoAlarm/TomatoAlarm.user.js
// ==/UserScript==

const button = document.createElement('div');
button.textContent = 'ðŸ…StartðŸ…';
button.style.cssText = `
    position: fixed;
    right: 10px;
    bottom: 10px;
    font-size: 1.2rem;
    line-height: 1.2rem;
    background: #fff;
    color: #737373;
    padding: 10px;
    border: solid 1px;
    border-radius: 50%;
    box-shadow: 0 2px 10px -6px rgba(0,0,0,.5), 0 3px 10px -4px rgba(0,0,0,.2);
    z-index: 10000;
`;
document.body.appendChild(button);

let beep = null;

button.onclick = e => {
    const base64Mp3 = "";
    beep = new Audio("data:audio/mp3;base64," + base64Mp3);
    button.style.display = "none";

    // Sound when notifications come in.
    setInterval(v => {
        beep?.play();
    }, 600_000);
}
